import {
    Navbar,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink
} from 'reactstrap';

const Header = () => {
    return(
        <header>
            <Navbar className='header'>
                <NavbarBrand href='/'>72-Hour Project</NavbarBrand>
                <Nav className='ml-auto' navbar>
                    <NavItem>
                        <NavLink href="https://github.com/AMJ-Codes/teamGit">
                            GitHub
                        </NavLink>                     
                    </NavItem>
                </Nav>
            </Navbar>
        </header>
    );
};

export default Header;
